import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material'

const Header = () => {
  return (
    <AppBar sx={{ background: "pink"}}>
      <Toolbar>
        <Typography variant='h4'>BlogsApp</Typography>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
